    let contador =1;
    function buttonClick(){
        contador++;
    }
    return (
        <>
        <h1> {props.msg} </h1>
        <h2>{contador++} </h2>
        <button onClick={buttonClick}>atualizar</button>
        </>
    )
}

export default Body;
